import { Component } from "react";
import { Menu, Dropdown } from "antd";
import "./index.css";

const menu = (
    <Menu>
      <Menu.Item key="1">借阅书籍</Menu.Item>
      <Menu.Item key="2">归还书籍</Menu.Item>
    </Menu>
  );

export default class Home extends Component {
    render() {
        return (
            <div className="back">
                <div className="top-left">图书管理系统</div>
                <div className="top-person">
                    {/* <Dropdown overlay={menu} trigger="hover">
                        用户名
                    </Dropdown> */}
                    <Dropdown placement="topLeft" overlay={menu} trigger="hover">
                        <p>用户名</p>
                    </Dropdown>
                </div>
            </div>
        )
    }
}
